import React, {FC} from "react"
import {Menu, MenuProps} from "@material-ui/core"


interface IMenu extends MenuProps {
    name: object,
}

export const CustomFormikMenu: FC<IMenu> = (props) => {

    return (
        <Menu {...props}>
            {props.children}
        </Menu>
    )
};
